import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import { useState } from 'react';
import { TextField } from '@mui/material';
import IconButton from '@mui/material/IconButton';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormControl from '@mui/material/FormControl';
import { Button } from '@mui/material';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import { createTheme, ThemeProvider } from '@mui/material/styles';


const Register = () => {

    const theme = createTheme({
        palette: {
            primary: {
            main: '#fbbf24',
            },
            secondary: {
            main: '#fbbf24', 
            },
        },
    });

    const [ value, setValue ] = useState('1');

    const handleChange = (event, newValue) => {
        setValue(newValue);
    }

    const [showPassword, setShowPassword] = useState(false);

    const handleClickShowPassword = () => setShowPassword((show) => !show);

    const handleMouseDownPassword = (event) => {
        event.preventDefault();
    };

    return (
        <div className='container'>
            <Box sx={{ width: '100%', typography: 'body1' }}>
                <TabContext value={value}>
                    <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                    <TabList onChange={handleChange} aria-label="lab API tabs example">
                        <Tab label="Register" value="1" />
                        <Tab label="Sign In" value="2" />
                    </TabList>
            </Box>

                    <TabPanel value="1">
                        <TextField id='outlined-basic' label="Full Name" variant='outlined' sx={{ width: '50%', mb: '2rem' }}/><br/>
                        <TextField id='outlined-basic' label="Email" type='email' variant='outlined' sx={{ width: '50%', mb: '2rem' }}/><br/>
                        <TextField id='outlined-basic' label="Username" variant='outlined' sx={{ width: '50%', mb: '2rem' }}/><br/>
                        
                        <FormControl sx={{ m: 1, width: '25ch' }} variant="outlined">
                        <InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
                        <OutlinedInput
                            id="outlined-adornment-password"
                            type={showPassword ? 'text' : 'password'}
                            endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                aria-label="toggle password visibility"
                                onClick={handleClickShowPassword}
                                onMouseDown={handleMouseDownPassword}
                                edge="end"
                                >
                                {showPassword ? <VisibilityOff /> : <Visibility />}
                                </IconButton>
                            </InputAdornment>
                            }
                            label="Password"
                        />
                        </FormControl>        
                        
                        ThemePo
                        <Button variant='contained' sx={{ height:'3rem', backgroundColor:'#991b1b' }}>Register Now</Button>
                    </TabPanel>
                    <TabPanel value="2">Item Two</TabPanel>
                </TabContext>
            </Box>
        </div>
    );
}

export default Register;
